import React from "react";
import { Link } from "react-router-dom";
import "./Card.css";

const Card = ({ countryId, name, flags, continent }) => {
  return (
    <div className="CardStyle">
      <Link to={`/home/${countryId}`}>
        <h3>{name}</h3>
      </Link>
      <h5>{continent}</h5>
      <img src={flags} alt="img not found" />
    </div>
  );
};

export default Card;
